    public function __construct() {
        $dbConn = new DBConnect();

        $this->conn = $dbConn->connect_db();
        if (is_null($this->conn)) {
            throw new Exception("no connection");
        }
    }

    public function getInitialDatabaseStatement() {
        try {
            $stmt = $this->conn->prepare($this->initialStr);
            $stmt->execute();
        } catch (Exception $e) {
            ChromePhp::log($e);
        } finally {
            if (!is_null($stmt)) {
                $stmt->closeCursor();
            }
        }
    }

